import React from 'react';
import { IconContext } from 'react-icons';
import { GrTwitter, GrInstagram, GrFacebook } from 'react-icons/gr';
import styles from './Header.module.css';

export default function Header() {
  return (
    <>
      <header>
        <div className="upper-section">
          <div className="number">
            <span>(52) 55 054 548 064</span>
          </div>
          <div className="social-media">
            <IconContext.Provider
              value={{ className: 'react-icon' }}
            >
              <GrFacebook className="react-icon" />
              <GrTwitter />
              <GrInstagram />
            </IconContext.Provider>
            <p className="react-icon">blablabla</p>
          </div>
        </div>
      </header>
      <style jsx>
        {`
        header{
          background-color: var(--second-brand-color);
        }
        .upper-section{
          display: flex;
          justify-content: space-around;
          align-items: center;
          padding-left: 50px;
        }
        .react-icon{
          color: white;
        }
      `}
      </style>
    </>
  );
}
